    <style>
      body, html {
        background-color: #000;
        margin: 0;
      }
      #ui {
        margin-top: 50px;
        margin-bottom: 50px;
        width: 100%;
        display:block;
      }

        background-color: rgba(41, 41, 41, 1);
        border-radius: 100%;
        border: 1px solid rgba(108, 108, 108, 1);
        color: #fff;
      }
      .delete {
        position: absolute;
        top:-14px;
        right: -14px;
        width: 40px;
        height: 40px;
        transform: rotate(45deg);
      }
      #addImage {
        display:block;
        margin: 0 auto;
        width: 50px;
        height: 50px;
      }
      #addTitle {
        margin: 0 auto 8px;
        display:block;
        background: transparent;
        border: 0;
        font-size: 42px;
        text-align: center;
      }
      input:focus,
      input {
        outline: none;
        border-radius: 8px;
        background-color: rgba(41, 41, 41, 1);
        border: 1px solid rgba(108, 108, 108, 1);
        color: #fff;
        min-height: 40px;
        padding-left: 8px;
        padding-right: 8px;
      }

      #board { /* Masonry container */
        column-count: 4;
        column-gap: 1em;
        padding: 32px;
        display: block;
        width: 100%;
        box-sizing: border-box;
      }
      @media only screen and (max-width: 480px) {
        #board { /* Masonry container */
          column-count: 1;
          column-gap: 1em;
          padding: 32px;
          display: block;
          width: 100%;
          box-sizing: border-box;
        }
      }
      .hide-delete .delete{
        display:none;
      }

      .pin { /* Masonry bricks or child elements */
        display: inline-block;
        position: relative;
        margin: 0 0 1em;
        width: 100%;
      }
      img {
        border-radius: 4px;
        width: 100%;
      }
      .hide {
        display: none !important;
      }
      #hideUI, #showUI {
        position: absolute;
        right: 8px;
        top: 8px;
        background-color: transparent;
        border: 0
      }
      .delete * {
        pointer-events: none;
      }
    </style>
    <script>
      const board = document.getElementById('board');
      const addTitle = document.getElementById('addTitle')
      const addImageButton = document.getElementById('addImage')
      const hideUIButton = document.getElementById('hideUI')
      const showUIButton = document.getElementById('showUI')
      function hideUI(){
        addTitle.disabled = false
        addImageButton.classList = ""
        showUIButton.classList = ""
        hideUIButton.classList = "hide"
        board.classList = ""
      }
      function showUI(){
        addTitle.disabled = true
        addImageButton.classList = "hide"
        showUIButton.classList = "hide"
        board.classList = "hide-delete"
        hideUIButton.classList = ""
      }
      function nameOfBoard(e) {
        document.title = 'ðŸŒ„_pin-'+e.target.value.replaceAll(' ', '-')
      }
      function addImage() {
        const board = document.getElementById('board');
        const imgSrc = prompt("paste image url");
        if(imgSrc !== null){
          toDataURLxhr(imgSrc, function (dataUrl) {
            const newPin = document.createElement('div');
            newPin.classList = "pin"
            newPin.innerHTML = `
            <button class="delete" onclick="deletePin(event)"><svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2" stroke-linecap="round" stroke-linejoin="round" class="feather feather-plus"><line x1="12" y1="5" x2="12" y2="19"></line><line x1="5" y1="12" x2="19" y2="12"></line></svg></button>
            <img src="${dataUrl}" />
            `;
            board.prepend(newPin)
          });
        }
      }
      function deletePin(e){
        event.target.parentElement.remove()
      }
      function toDataURLxhr(url, callback) {
        var xhr = new XMLHttpRequest();
        xhr.onload = function() {
          var reader = new FileReader();
          reader.onloadend = function() {
            callback(reader.result);
          }
          reader.readAsDataURL(xhr.response);
        };
        xhr.open('GET', url);
        xhr.responseType = 'blob';
        xhr.send();
      }
    </script>
